import React from 'react';
import ReactDOM from 'react-dom';

function Sum(a,b)
{
    Sum=a+b;
    return Sum;

}
function Sub(a,b)
{
    Sub=a-b;
    return Sub;

}
function Mul(a,b)
{
    Mul=a*b;
    return Mul;

}

export default Sum;
